import React from 'react';
import Card from './Card.js'

const Cards = () => {

    const plants = {
        name: "plant-1",
        color: "green"
    }

    return (
        <div className="cards-container">
            <Card name={plants.name} color={plants.color}/>
        </div>

    )
}

export default Cards;
